import React from 'react';
import { GoogleMap, GoogleApiWrapper } from 'react-google-maps';

const mapStyle = {
    width: '100%',
    height: '100%'
};

class LeadMap extends React.Component {
    render(){
        return(
            <Map
                google = {this.props.google}
                zoom = {14}
                style = {mapStyle}
                initCenter = {
                    {
                    lat: 37.342831962,
                    lng: -121.936162922
                    }
                }
            />
        ); 
    }
}

export default GoogleApiWrapper({
    apiKey: 'AIzaSyBp65a7X_GWKi9xt9bk_n0DcRAPqZby988'
}) (LeadMap)
